import React, { useState } from 'react';
import { Box, Typography, Button } from '@mui/material';
import ResultsTable from './ResultsTable';

const BatchUpload = () => {
  const [file, setFile] = useState(null);
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleFileChange = (e) => {
    const selectedFile = e.target.files[0];
    if (!selectedFile) return;

    if (!selectedFile.name.endsWith('.csv')) {
      alert("Bitte wählen Sie eine gültige CSV-Datei aus.");
      return;
    }

    setFile(selectedFile);
  };

  const handleUpload = async () => {
    if (!file) {
      alert("Bitte wählen Sie eine CSV-Datei aus.");
      return;
    }

    setLoading(true);
    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await fetch('http://localhost:5100/predict-batch', {
        method: 'POST',
        body: formData
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();

      if (data.error) {
        setResults({
          error: data.error,
          message: "Bitte überprüfen Sie das Format Ihrer CSV-Datei."
        });
        return;
      }

      setResults(data.results);
    } catch (error) {
      console.error('Fehler beim Upload:', error);
      setResults({
        error: error.message,
        message: "Bitte stellen Sie sicher, dass Ihre CSV-Datei folgende Spalten enthält:",
        requirements: [
          "firstName (Vorname)",
          "lastName (Nachname)",
          "linkedinProfile (LinkedIn-URL)",
          "positions (Berufserfahrungen im JSON-Format)"
        ]
      });
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box sx={{ p: 4 }}>
      <Typography
        variant="h4"
        component="h1"
        sx={{
          color: '#0A1929',
          fontWeight: 700,
          mb: 2
        }}
      >
        Batch-Prognose
      </Typography>

      <Typography
        sx={{
          color: '#666',
          mb: 4,
          fontSize: '1.1rem'
        }}
      >
        Laden Sie eine CSV-Datei hoch, um die Wechselwahrscheinlichkeit
        mehrerer Kandidaten gleichzeitig zu analysieren.
      </Typography>

      <Box
        className="form-group"
        sx={{
          bgcolor: 'white',
          borderRadius: 4,
          p: 4,
          boxShadow: '0 8px 25px rgba(0, 0, 0, 0.1)',
          mb: 4
        }}
      >
        <Typography
          variant="h6"
          sx={{
            color: '#0A1929',
            fontWeight: 600,
            mb: 3
          }}
        >
          CSV-Datei hochladen
        </Typography>

        <Box
          className="file-upload-wrapper"
          sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            gap: 2
          }}
        >
          <input
            type="file"
            id="csvFile"
            accept=".csv"
            onChange={handleFileChange}
            style={{ display: 'none' }}
          />
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, width: '100%' }}>
            <Button
              component="label"
              htmlFor="csvFile"
              variant="outlined"
              sx={{
                bgcolor: 'white',
                border: '1px solid rgba(0, 0, 0, 0.23)',
                color: 'black',
                textTransform: 'none',
                px: 3,
                minWidth: 'auto',
                '&:hover': {
                  bgcolor: 'rgba(0, 0, 0, 0.04)',
                  border: '1px solid rgba(0, 0, 0, 0.23)'
                }
              }}
            >
              Datei auswählen
            </Button>
            <Typography sx={{ color: '#666', flex: 1, textAlign: 'right' }}>
              {file ? file.name : 'Keine ausgewählt'}
            </Typography>
          </Box>

          <Button
            onClick={handleUpload}
            disabled={!file || loading}
            sx={{
              width: '100%',
              maxWidth: '400px',
              bgcolor: '#4285f4',
              color: 'white',
              textTransform: 'none',
              py: 1.5,
              borderRadius: 2,
              fontWeight: 600,
              '&:hover': {
                bgcolor: '#3367d6'
              },
              '&.Mui-disabled': {
                bgcolor: '#f1f3f4',
                color: '#80868b'
              }
            }}
          >
            {loading ? 'Wird verarbeitet...' : 'Prognose erstellen'}
          </Button>
        </Box>
      </Box>

      {loading && (
        <Box 
          className="loader-container-prediction"
          sx={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100px',
            my: 4
          }}
        >
          <Box 
            className="loader-prediction"
            sx={{
              border: '4px solid #f3f3f3',
              borderTop: '4px solid #FF5F00',
              borderRadius: '50%',
              width: '40px',
              height: '40px',
              animation: 'spin 1s linear infinite',
              '@keyframes spin': {
                '0%': { transform: 'rotate(0deg)' },
                '100%': { transform: 'rotate(360deg)' }
              }
            }}
          />
        </Box>
      )}

      {results && <ResultsTable results={results} />}
    </Box>
  );
};

export default BatchUpload;
